import React from "react";
import Friend from "./Friend";
const numbers = [];
for (let i = 0; i <= 9; i++) {
    numbers[i] = i;
}
const DreamTeam = (props) => {
    const friends = numbers.filter(number => number !== props.hero);
    return (
        <section className="ml-1 float-right row w-50 border border-light rounded-bottom no-gutters">
            <h2 className="col-12 text-center">Dream team</h2>
            <div>
                {friends.map((number, index) => <Friend key={number} friend={number} index={index}/>)}
            </div>
        </section>
    );
};

export default DreamTeam;
